import { makeStyles } from '@material-ui/core/styles';
import React from 'react';
import annotationlist from '../../static/annotationlist.json';
import TextField from '@material-ui/core/TextField';
import FormControl from '@material-ui/core/FormControl';
import InputLabel from '@material-ui/core/InputLabel';

const qalist = annotationlist.annotatonlist;

function qaform(resultKey, resultValue) {
    return (
        <FormControl>
            <InputLabel htmlFor="data"></InputLabel>
            <div style={{ marginBottom: '5%' }}>
                <TextField
                    label={resultKey}
                    defaultValue={resultValue}
                    variant="outlined"
                    fullWidth
                    InputProps={{
                        readOnly: true,
                    }}
                />
            </div>
        </FormControl>
    );
}


const useStyles = makeStyles((theme) => ({
    root: {
        height:'90%',
        display: 'flex',
        flexDirection: 'column',
        overflow: 'auto',
        padding: theme.spacing(2),
    },
  }));

export default function QAList({ fileId }){
    const classes = useStyles();

    return(
        <div className={classes.root} id='qalist'>
            {
                qalist.map((qa) => {
                    if (qa.fileID === fileId)
                        return qaform(qa.resultKey, qa.resultValue)   
                    else
                        return null
                })
            }
        </div>
    );
}

